summary.label:
Localize os médicos, clínicas, hospitais e laboratórios na nossa rede de atendimento. Faça buscas nas cidades com cobertura para listar todos os prestadores ou especifique uma especialidade. Ao encontrar o prestador desejado será possível:

- Incluí-lo em sua lista de favoritos;
- Visualizar o endereço e acionar um aplicativo de GPS instalado para navegar até ele;
- Iniciar uma chamada telefônica;
- Adicioná-lo em sua agenda de contatos;
- Compartilhá-lo utilizando o Gmail, Facebook, WhatsApp, etc.

Importante: este é o aplicativo oficial da Evida , desenvolvido e oferecido pela fornecedora de software contratada Fácil Informática. Para entrar em contato conosco, faça uma avaliação ou envie um e-mail para mobile@facilinformatica.com.br.

A busca da rede de atendimento pode ser feita pela localização do beneficiário, tipo de prestador, especialidade, tipo de plano ou pelo nome do profissional ou estabelecimento de saúde.  

Tudo isso com uma interface simples e amigável. O aplicativo aponta o caminho mais próximo entre o beneficiário e o prestador que ele procura, utilizando o sistema de geolocalização do aparelho. Permite definir rotas pelo mapa. 
Com apenas um toque o prestador ou estabelecimento pode ser incluído na lista de favoritos. Periodicamente acesse a área de notícias e mantenha-se informado sobre o seu plano de saúde.
